pub enum Bson {

    /// 64-bit binary floating point
    Double(f64),

    /// UTF-8 string
    String(String),

    /// Array
    Array(Array),

    /// Embedded document
    Document(Document),

    /// Boolean value
    Boolean(bool),

    /// Null value
    Null,

    /// Regular expression
    RegularExpression(Regex),

    /// JavaScript code
    JavaScriptCode(String),

    /// JavaScript code w/ scope
    JavaScriptCodeWithScope(JavaScriptCodeWithScope),

    /// 32-bit signed integer
    Int32(i32),

    /// 64-bit signed integer
    Int64(i64),

    /// Timestamp
    Timestamp(Timestamp),

    /// Binary data
    Binary(Binary),

    /// [ObjectId](http://dochub.mongodb.org/core/objectids)
    ObjectId(oid::ObjectId),

    /// UTC datetime
    DateTime(chrono::DateTime<Utc>),

    /// Symbol (Deprecated)
    Symbol(String),

    /// [128-bit decimal floating point](https://github.com/mongodb/specifications/blob/master/source/bson-decimal128/decimal128.rst)
    Decimal128(Decimal128),

    /// Undefined value (Deprecated)
    Undefined,

    /// Max key
    MaxKey,

    /// Min key
    MinKey,

    /// DBPointer (Deprecated)
    DbPointer(DbPointer),
}

pub enum Error {

    /// A [`std::io::Error`](https://doc.rust-lang.org/std/io/struct.Error.html) encountered while deserializing.
    IoError(io::Error),

    /// A [`std::string::FromUtf8Error`](https://doc.rust-lang.org/std/string/struct.FromUtf8Error.html) encountered
    /// while decoding a UTF-8 String from the input data.
    FromUtf8Error(string::FromUtf8Error),

    /// While decoding a `Document` from bytes, an unexpected or unsupported element type was
    /// encountered.
    UnrecognizedDocumentElementType {
        /// The key at which an unexpected/unsupported element type was encountered.
        key: String,
        /// The encountered element type.
        element_type: u8,
    },

    /// There was an error with the syntactical structure of the BSON.
    SyntaxError {
        message: String,
    },

    /// The end of the BSON input was reached too soon.
    EndOfStream,

    /// An invalid timestamp was encountered while decoding.
    InvalidTimestamp(i64),

    /// An ambiguous timestamp was encountered while decoding.
    AmbiguousTimestamp(i64),

    /// A general error encountered during deserialization.
    /// See: https://docs.serde.rs/serde/de/trait.Error.html
    DeserializationError {
        /// A message describing the error.
        message: String,
    },
}

pub enum ValueAccessError {

    /// Cannot find the expected field with the specified key
    NotPresent,

    /// Found a Bson value with the specified key, but not with the expected type
    UnexpectedType,
}

pub enum Error {

    /// Errors that can occur during OID construction and generation from the input data.
    InvalidObjectId(oid::Error),

    /// A general error encountered during deserialization.
    /// See: https://docs.serde.rs/serde/de/trait.Error.html
    DeserializationError {
        message: String,
    },
}

pub enum Error {

    /// An invalid argument was passed in.
    ArgumentError {
        message: String,
    },

    /// An error occured parsing a hex string.
    FromHexError(FromHexError),
}

pub enum Error {

    /// A [`std::io::Error`](https://doc.rust-lang.org/std/io/struct.Error.html) encountered while serializing.
    IoError(io::Error),

    /// A key could not be serialized to a BSON string.
    InvalidMapKeyType {
        /// The value that could not be used as a key.
        key: Bson,
    },

    /// A general error that ocurred during serialization.
    /// See: https://docs.rs/serde/1.0.110/serde/ser/trait.Error.html#tymethod.custom
    SerializationError {
        /// A message describing the error.
        message: String,
    },

    #[cfg(not(feature = "u2i"))]
    /// Returned when serialization of an unsigned integer was attempted. BSON only supports
    /// 32-bit and 64-bit signed integers.
    ///
    /// To allow serialization of unsigned integers as signed integers, enable the "u2i" feature
    /// flag.
    UnsupportedUnsignedType,
}

pub enum ElementType {

    /// 64-bit binary floating point
    Double = ,

    /// UTF-8 string
    String = ,

    /// Embedded document
    EmbeddedDocument = ,

    /// Array
    Array = ,

    /// Binary data
    Binary = ,

    /// Deprecated. Undefined (value)
    Undefined = ,

    /// [ObjectId](http://dochub.mongodb.org/core/objectids)
    ObjectId = ,

    /// Bool value
    Boolean = ,

    /// UTC datetime
    DateTime = ,

    /// Null value
    Null = ,

    /// Regular expression - The first cstring is the regex pattern, the second is the regex
    /// options string. Options are identified by characters, which must be stored in
    /// alphabetical order. Valid options are 'i' for case insensitive matching, 'm' for
    /// multiline matching, 'x' for verbose mode, 'l' to make \w, \W, etc. locale dependent,
    /// 's' for dotall mode ('.' matches everything), and 'u' to make \w, \W, etc. match
    /// unicode.
    RegularExpression = ,

    /// Deprecated.
    DbPointer = ,

    /// JavaScript code
    JavaScriptCode = ,

    /// Deprecated.
    Symbol = ,

    /// JavaScript code w/ scope
    JavaScriptCodeWithScope = ,

    /// 32-bit integer
    Int32 = ,

    /// Timestamp
    Timestamp = ,

    /// 64-bit integer
    Int64 = ,

    /// [128-bit decimal floating point](https://github.com/mongodb/specifications/blob/master/source/bson-decimal128/decimal128.rst)
    Decimal128 = ,
    MaxKey = ,
    MinKey = ,
}
